import Vue from "vue"
import Api from "../api/api"
import Util from "./util"
import lang from "../language/CN"
import lang2 from "../language/EN"
import lang3 from "../language/eses"
import lang4 from "../language/ruru"
import lang5 from "../language/ptpt"
import lang6 from "../language/frfr"
import lang7 from "../language/jajp"
import lang8 from "../language/dede"
import lang9 from "../language/itit"
import lang10 from "../language/kokr"
import lang11 from "../language/ar"
import lang12 from "../language/tr"
import lang13 from "../language/vi"
import lang14 from "../language/th"
import lang15 from "../language/nl"
import lang16 from "../language/he"
import lang17 from "../language/id"
window.lang = lang
window.lang2 = lang2
window.lang3 = lang3
window.lang4 = lang4
window.lang6 = lang6
window.lang8 = lang8
window.lang9 = lang9
window.lang10 = lang10
window.lang11 = lang11
window.lang12 = lang12
window.lang13 = lang13
window.lang14 = lang14
window.lang15 = lang15
window.lang16 = lang16
window.lang17 = lang17
import {mapGetters, mapActions} from 'vuex'
Vue.mixin({
  data() {
    return {
      api:Api,    
      errorImage:"data:image/png;base64,",
      lang:lang, 
      util:new Util()
    }
  },
  computed: {
    ...mapGetters([
      'app_user',
      'app_token'
    ])
  },  
  created() {
      switch(this.$route.query.lang){
          case 'zh':
          this.lang = lang;
          break;
          case 'en':
          this.lang = lang2;
          break;
          case 'es':
          this.lang = lang3;
          break;
          case 'ru':
          this.lang = lang4;
          break;
          case 'pt':
          this.lang = lang5;
          break;
          case 'fr':
          this.lang = lang6;
          break;
          case 'ja':
          this.lang = lang7;
          break;
          case 'de':
          this.lang = lang8;
          break;
          case 'it':
          this.lang = lang9;
          break;
          case 'ko':
          this.lang = lang10;
          break;
          case 'ar':
          this.lang = lang11;
          break;
          case 'tr':
          this.lang = lang12;
          break;
          case 'vi':
          this.lang = lang13;
          break;
          case 'th':
          this.lang = lang14;
          break;
          case 'nl':
          this.lang = lang15;
          break;
          case 'il':
          this.lang = lang16;
          break;
          case 'in':
          this.lang = lang17;
          break;
          default:
          console.log("空")
      }
  },
  mounted() {
      
  },
  methods: { 
    closePage(){
        // 关闭页面
        console.log("关闭")
        window.pushApp.closePage.func()
    },
    openPage(url){
      console.log(window.ip_+url)
      window.pushApp.openPage.func(window.ip_+url)
    },
    tips_(res){
      if(res.data.state==1){
        this.$message({
          type: 'success',
          message:res.data.message
        });
        return true;
      }else{
        this.$message.error(res.data.message);
        return false;
      }
    },   
    login(){
      this.Http(this.api["Login"],{
        account : "18108684949",
        loginType: 1
      }).then( res =>{
          if(res.data.code == "000"){
            this.set_app_token(res.data.result.accessToken)
            this.set_app_user(res.data.result)
          }
      })
    },
    initTheme(){ // 修改主题
      if(localStorage.styleTheme){
          let root= document.querySelector(':root');     
          let d = JSON.parse(localStorage.styleTheme)
          let style = ""
          for(let i = 0;i < d.length;i++){
              if(i!=0){
                style += ";"
              }
              style += `${d[i].var}:${d[i].value}`   
          }
          root.setAttribute('style',style);   
      }
    },
    ...mapActions([
      'set_app_user',
      'set_app_token'
    ])
  }
})
